INSERT INTO `fundamentos` (`id_fundamentos`, `titulo_fundamento`, `descricao`, `imagem_fundamento`) VALUES
(1, '1. Saque por Baixo', 'O saque por baixo no vôlei é uma técnica simples e eficaz, especialmente para iniciantes ou quando o objetivo é garantir que a bola entre em jogo com consistência. Veja o passo a passo para realizar um saque por baixo corretamente:<br>\r\n<br>• Fique de pé com os pés afastados na largura dos ombros, uma perna ligeiramente à frente da outra.<br>\r\n\r\n<br>• Segure a bola com a mão não dominante. O braço que não está segurando a bola deve estar ao lado do corpo, ligeiramente flexionado, pronto para realizar o movimento de saque. Incline-se levemente para frente, flexionando os joelhos para ter um bom equilíbrio e uma base firme.<br>\r\n\r\n<br>• Mantenha o braço que vai golpear a bola estendido para trás. Existe algumas formas de lançar a bola, uma delas é fechando a mão e cerrando o punho, e em seguida, gire o braço para que os dedos fechados e a parte interna do pulso fiquem voltados para cima, ou também você pode virar o punho para o lado, direcionando-o para dentro, e deixando o polegar voltado para cima. Imagine seu punho batendo na bola e seguindo uma linha até o ponto da quadra onde quer que ela caia.<br>\r\n\r\n<br>• A bola é segurada próxima ao quadril da perna que está à frente. Certifique-se de que a bola esteja a uma altura confortável para ser golpeada. Leve o braço que vai golpear a bola para frente em um movimento de pêndulo. Ao golpear a bola, mantendo o braço estendido e firme. Golpeie a parte inferior da bola com força e precisão, tentando manter a bola baixa e direcionada ao campo adversário. Após o impacto, o braço deve continuar o movimento natural para cima, seguindo a trajetória da bola.<br>\r\n\r\n<br>• Concentre-se em manter a bola dentro dos limites da quadra, direcionando-a para áreas que possam dificultar a recepção do adversário.<br>', );
INSERT INTO `fundamentos` (`id_fundamentos`, `titulo_fundamento`, `descricao`, `imagem_fundamento`) VALUES
(2, '2. Saque por Cima', 'O saque por cima no vôlei é uma técnica um pouco mais avançada, que permite gerar mais força e efeitos na bola, tornando-a mais difícil de ser recebida pelo adversário. Aqui está um passo a passo para executar corretamente um saque por cima:<br>\r\n<br>• Fique de pé, com os pés afastados na largura dos ombros, uma perna um pouco à frente da outra para garantir estabilidade.<br>\r\n\r\n<br>• Segure a bola com a mão oposta à que você vai sacar. Lance a bola levemente para cima, cerca de 30 a 60 cm acima da sua cabeça, mantendo o lançamento alinhado com o braço de ataque. O lançamento deve ser controlado e consistente, garantindo que a bola fique na trajetória ideal para o saque. Simultaneamente ao lançamento, o braço que vai realizar o saque deve ser levado para trás, com o cotovelo flexionado, preparando-se para golpear a bola. <br>\r\n\r\n<br>• Ao iniciar o movimento de saque, estenda o braço rapidamente em direção à bola, utilizando o peso do corpo para dar mais força ao movimento. Bata na bola com a palma. O braço deve estar completamente estendido no momento do impacto, e a bola deve ser atingida no ponto mais alto do movimento para garantir potência e precisão. Após o impacto, o braço deve continuar o movimento natural para frente, completando o gesto do saque.\r\n', );
INSERT INTO `fundamentos` (`id_fundamentos`, `titulo_fundamento`, `descricao`, `imagem_fundamento`) VALUES
(3, '3. Saque Viagem', 'O saque viagem é um tipo de saque no vôlei que combina a força de um saque por cima com a precisão de um saque estratégico. Ele é frequentemente utilizado para surpreender o adversário, pois a bola pode ser lançada em uma trajetória difícil de prever e de receber. Aqui está um passo a passo para realizar o saque viagem:<br>\n<br>• Fique de pé atrás da linha de fundo, com os pés afastados na largura dos ombros. Segure a bola com a mão oposta à que você usará para sacar.<br>\n\n<br>• Lance a bola à frente de você e um pouco para cima, na direção onde você deseja sacar. O lançamento deve ser alto o suficiente para que você consiga realizar o saque no ponto mais alto do seu salto. O lançamento precisa ser preciso para que a bola caia diretamente na trajetória do seu braço durante o salto. <br>\n\n<br>• Após lançar a bola, dê alguns passos rápidos para frente (normalmente três passos: dois pequenos e o terceiro mais longo) para ganhar impulso. No último passo, concentre a força no pé de apoio e faça um salto explosivo, elevando-se o mais alto possível. Enquanto você salta, leve o braço que vai realizar o saque para trás, com o cotovelo flexionado. No ponto mais alto do seu salto, estenda o braço rapidamente e golpeie a bola com a palma da mão, usando um movimento forte e controlado. O impacto deve ser feito com a mão aberta, e você deve bater na bola no ponto mais alto possível, colocando força e direcionando a bola com precisão.<br>\n\n<br>• Após o impacto, o braço deve continuar o movimento natural para baixo. O corpo deve seguir o movimento, com os pés aterrissando suavemente e o peso do corpo transferido para a frente. O objetivo é que a bola viaje rapidamente em direção ao campo adversário, com uma trajetória descendente e alta velocidade, dificultando a recepção.', );
INSERT INTO `fundamentos` (`id_fundamentos`, `titulo_fundamento`, `descricao`, `imagem_fundamento`) VALUES
(4, '4. Recepção', 'A recepção no voleibol é uma das ações mais importantes na defesa e no início da transição para o ataque. Também chamada de \"passe\" , a recepção é uma habilidade de receber o saque adversário e passar a bola de maneira controlada para o levantador, que então organizará o ataque da equipe. A técnica mais comum na recepção é o passe de manchete e para executa-lo basta:<br>\r\n<br>• Ficar em uma posição estável, com os pés afastados na largura dos ombros. Os joelhos devem estar levemente flexionados e o corpo deve estar em uma posição baixa e equilibrada.<br>\r\n<br>• Junte as palmas das mãos, sobrepondo uma sobre a outra, e encoste a lateral do seus polegares um com  outro, formando assim uma \"conchinha\".<br>\r\n<br>• Posicione-se de maneira que a parte inferior da bola possa ser atingida com a parte inferior dos antebraços. Ao receber a bola, flexione os joelhos e use o corpo para absorver o impacto. Isso ajuda a manter o controle da bola.<br>\r\n<br>• Após a manchete, mantenha a postura equilibrada, pronto para a próxima jogada, seja em defesa ou em ataque.<br>', );
INSERT INTO `fundamentos` (`id_fundamentos`, `titulo_fundamento`, `descricao`, `imagem_fundamento`) VALUES
(5, '5. Levantamento', 'O levantamento no vôlei é uma técnica crucial, pois é o momento em que o levantador prepara a bola para que o atacante possa realizar a cortada. É uma jogada de transição que exige precisão, rapidez e um bom entendimento do jogo, pois o levantador deve decidir para qual jogador irá levantar a bola com base na situação do jogo e na posição dos adversários. Para executa-lo você precisa saber que:<br>\r\n\r\n<br>• O levantador geralmente se posiciona perto da rede, entre as posições 2 e 3, para ter uma visão ampla da quadra e facilitar o passe para os atacantes.<br>\r\n<br>• Ele deve estar em uma postura equilibrada, com os joelhos levemente flexionados e o corpo pronto para se mover rapidamente em qualquer direção, já que muitas vezes o passe que vem da recepção pode não ser perfeito. <br>\r\n<br>• O levantamento é feito com as mãos. Ao receber uma bola, as mãos devem estar na altura da testa, com os dedos abertos e apontando para a bola. O contato com a bola é feito com os dedos, polegares, indicadores e dedos médios. A bola deve ser tocada suavemente com os dedos, e não com as palmas das mãos. Isso garante um toque mais preciso e evita que a bola saia de controle.<br>\r\n<br>• Os cotovelos devem ser levemente dobrados, permitindo flexibilidade e força no levantamento.<br>\r\n<br>• Além do movimento dos braços, as pernas desempenham um papel importante no levantamento. O levantador deve flexionar os joelhos ao receber a bola e depois estendê-los para gerar força no levantamento.<br>\r\n<br>• Após o levantamento, esteja preparado para a próxima jogada. Você pode precisar se reposicionar rapidamente para defender ou continuar a sequência de ataque.<br>', );
INSERT INTO `fundamentos` (`id_fundamentos`, `titulo_fundamento`, `descricao`, `imagem_fundamento`) VALUES
(6, '6. Ataque', 'O ataque é o fundamento que geralmente finaliza um rally. O ataque é uma das principais ações expostas, e seu objetivo é enviar a bola para o lado adversário de maneira que seja difícil de ser defendida. O ataque é geralmente realizado após um passe ou levantamento, e envolve uma combinação de força, técnica e precisão. Aqui está um passo a passo para executar corretamente um saque ataque:<br>\r\n<br>• O jogador que vai atacar começa posicionado atrás da linha de ataque, pronto para correr em direção à rede. <br>\r\n<br>• A corrida é feita em uma sequência de três passos (direito, esquerdo, direito ou vice-versa), aumentando a velocidade até o salto. Para realizar o ataque é necessário o levantamento, quanto melhor o levantamento, melhor o ataque.<br>\r\n<br>• Quando levanta a bola para o atacante, durante o salto ele prepara o braço de ataque, levantando-o para trás, como se fosse uma catapulta, enquanto o braço não dominante fica à frente para equilíbrio, e no ponto mais alto do salto, o atacante usa o braço dominante para bater na bola com a mão aberta, enviando-a com força para o lado adversário. <br>\r\n<br>• Após o ataque, o jogador se aterrissa suavemente no chão, flexionando os joelhos para absorver o impacto e se preparar para a próxima jogada, caso necessário.<br>\r\n \r\n', );
INSERT INTO `fundamentos` (`id_fundamentos`, `titulo_fundamento`, `descricao`, `imagem_fundamento`) VALUES
(7, '7. Bloqueio', 'O bloqueio no vôlei é uma ação de defesa que tem como objetivo interceptar o ataque adversário, impedindo que a bola passe para o seu lado da quadra ou, pelo menos, desviando a bola para facilitar a defesa. É uma das principais formas de evitar que o adversário marque pontos. Para executa-lo é preciso saber que:<br>\r\n<br>• O jogador de bloqueio deve ficar próximo da rede, em posição de alerta e com as pernas levemente flexionadas, pronto para saltar. Mantenha-se na frente do adversário, mas sempre preparado para se mover rapidamente pelos lados, se necessário.<br>\r\n<br>• Fique de olho no levantador do time adversário, assim que ele armar a jogada, foque no atacante para tentar prever para onde ele irá atacar. Use sua visão periférica para observar a bola e o movimento do adversário.<br>\r\n<br>• Salte logo após o adversário começar a executar o ataque. Se você pular muito cedo, o atacante pode desviar do seu bloqueio; se for muito tarde, a bola já terá passado. Ao saltar, mantenha as mãos abertas e os braços esticados. O objetivo é interceptar a bola antes que ela passe pela rede, colocando as mãos e antebraços na trajetória da cortada. As mãos devem estar firmes e abertas, com os dedos afastados para cobrir o máximo de área possível. Os dedos devem estar voltados para baixo, formando uma barreira que \"empurra\" a bola de volta para o lado adversário.\r\nEsteja pronto para reagir rapidamente caso o adversário recupere a bola, ou se a bola tocar no bloqueio e voltar para sua quadra. Evite deixar os braços muito próximos ao corpo ou flexionados, pois isso pode facilitar o ataque adversário passar por cima.<br>\r\n<br>• Após o salto, mantenha os joelhos flexionados para absorver o impacto da queda. Estar pronto para reagir é importante, pois a bola pode voltar ao seu caso lado o bloqueio não seja perfeito.<br>', );

